import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>This is the SuperLeague's Football App </h1>
      <form action="/action_page.php">
      <div class="dropdown">
        <label>Pick your Team </label>
        <button class="dropbtn">Dropdown</button>
        <div class="dropdown-content">
          <a href="#">Link 1</a>
          <a href="#">Link 2</a>
          <a href="#">Link 3</a>
        </div>
</div>
      </form>
    </div>
  );
}

export default App;
